import React from "react";
import "../index.css";
import { FaDumbbell, FaHeartbeat, FaBrain, FaInfoCircle } from "react-icons/fa";

const dashboardData = [
  {
    condition: "Orthopedic Rehab",
    icon: <FaDumbbell size={24} />,
    exercises: ["Knee Bends", "Leg Raises", "Heel Slides"],
    color: "bg-blue-200"
  },
  {
    condition: "Cardiac Rehab",
    icon: <FaHeartbeat size={24} />,
    exercises: ["Marching in Place", "Arm Raises", "Breathing Exercises"],
    color: "bg-red-200"
  },
  {
    condition: "Neuro Rehab",
    icon: <FaBrain size={24} />,
    exercises: ["Balance Training", "Arm Circles", "Cognitive Tasks"],
    color: "bg-purple-200"
  },
  {
    condition: "Physiotherapy Tips",
    icon: <FaInfoCircle size={24} />,
    exercises: ["Maintain posture", "Hydrate", "Breathe during stretches"],
    color: "bg-green-200"
  },
];

const Dashboard = () => {
  return (
    <div className="p-6 bg-gray-50 min-h-screen">
      <h1 className="text-3xl font-bold text-center text-blue-800 mb-6">Patient Exercise Dashboard</h1>
      <div className="grid gap-6 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 animate-fade-in">
        {dashboardData.map((card, index) => (
          <div
            key={index}
            className={`rounded-xl shadow-lg transform hover:scale-105 transition-transform p-5 ${card.color}`}
          >
            <div className="flex items-center justify-between mb-2">
              <h2 className="text-xl font-semibold text-gray-800">{card.condition}</h2>
              {card.icon}
            </div>
            <ul className="mt-2 list-disc pl-5 text-sm text-gray-700">
              {card.exercises.map((ex, i) => (
                <li key={i}>{ex}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
